-- TASK 1: Table Definitions

-- Table 1: Person
CREATE TABLE Person (
    person_id INT PRIMARY KEY,
    first_name VARCHAR(50),
    middle_name VARCHAR(50),
    last_name VARCHAR(50),
    email VARCHAR(100),
    gender VARCHAR(10),
    date_of_birth DATE
);








































-- Table 2: Camp
CREATE TABLE Camp (
    camp_id INT PRIMARY KEY,
    camp_title VARCHAR(100),
    start_date DATE
);

-- Table 3: Camp_Visit
CREATE TABLE Camp_Visit (
    visit_id INT PRIMARY KEY,
    person_id INT,
    camp_id INT,
    visit_date DATE,
    FOREIGN KEY (person_id) REFERENCES Person(person_id),
    FOREIGN KEY (camp_id) REFERENCES Camp(camp_id)
);

-- TASK 2: Populate Person Table with 5000 Random People

-- Using CTEs to generate random data
WITH RECURSIVE numbers AS (
    SELECT 1 AS n
    UNION ALL
    SELECT n + 1 FROM numbers WHERE n < 5000
),
gender_dist AS (
    SELECT n,
           CASE 
               WHEN n <= 3250 THEN 'Female'
               ELSE 'Male'
           END AS gender
    FROM numbers
),
age_dist AS (
    SELECT n,
           CASE 
               WHEN n <= 2500 THEN FLOOR(RAND() * 6) + 7         -- Age 7–12
               WHEN n <= 3850 THEN FLOOR(RAND() * 2) + 13        -- Age 13–14
               WHEN n <= 4850 THEN FLOOR(RAND() * 3) + 15        -- Age 15–17
               ELSE FLOOR(RAND() * 2) + 18                        -- Age 18–19
           END AS age
    FROM numbers
),
person_data AS (
    SELECT g.n AS person_id,
           CONCAT('First', g.n) AS first_name,
           CONCAT('Middle', g.n) AS middle_name,
           CONCAT('Last', g.n) AS last_name,
           CONCAT('user', g.n, '@example.com') AS email,
           g.gender,
           DATE_SUB(CURDATE(), INTERVAL a.age YEAR) AS date_of_birth
    FROM gender_dist g
    JOIN age_dist a ON g.n = a.n
)
SELECT * FROM person_data;

-- TASK 3: Gender Distribution by Age Group

SELECT
    CASE 
        WHEN TIMESTAMPDIFF(YEAR, date_of_birth, CURDATE()) BETWEEN 7 AND 12 THEN 'Gen Alpha'
        WHEN TIMESTAMPDIFF(YEAR, date_of_birth, CURDATE()) BETWEEN 13 AND 14 THEN 'Gen Z'
        WHEN TIMESTAMPDIFF(YEAR, date_of_birth, CURDATE()) BETWEEN 15 AND 17 THEN 'Millennials'
        ELSE 'Gen X'
    END AS generation,
    gender,
    COUNT(*) AS count,
    ROUND(COUNT(*) * 100.0 / SUM(COUNT(*)) OVER (PARTITION BY 
        CASE 
            WHEN TIMESTAMPDIFF(YEAR, date_of_birth, CURDATE()) BETWEEN 7 AND 12 THEN 'Gen Alpha'
            WHEN TIMESTAMPDIFF(YEAR, date_of_birth, CURDATE()) BETWEEN 13 AND 14 THEN 'Gen Z'
            WHEN TIMESTAMPDIFF(YEAR, date_of_birth, CURDATE()) BETWEEN 15 AND 17 THEN 'Millennials'
            ELSE 'Gen X'
        END
    ), 2) AS percentage
FROM Person
GROUP BY generation, gender;
